Game Description:
******************
Have you ever wanted to rule a Kingdom? Now you have a chance to do so! Help the Princess to make her lieges happy!

A Very young princess wants her kingdom to be prosperous, and its inhabitants were happy. The Razz constantly engaged in battles with the orcs and he did not have enough time for the improvement of their lands. Life taking its course: crumbling shacks, residents suffer from malnutrition, the whole country is in decline. Princess really wants to help Razz's subjects, but she is very young and inexperienced. You'll have to help her in this difficult matter. Take care of the welfare of the kingdom, help the young person of advice of an experienced builder and wise treasurer, bring all spheres of life in order and Bring prosperity!

